import React from "react";
import {Container, Row, Col, Image, Button} from 'react-bootstrap';

function visitorDashboard(props) {
    console.log(props.viewuserdata);

    return(
        <Container style={{ color: 'white'}}>
            <Row className='mt-5'>
                <div>id: {props.viewuserdata.id}</div>
                <div>currentLevel: {props.viewuserdata.currentLevel}</div>
                <div>referrerID: {props.viewuserdata.referrerID}</div>
                <div>totalEarningUSDT: {props.viewuserdata.totalEarningUSDT}</div>
                <div></div>
            </Row>
        </Container>
    )
}

export default visitorDashboard;
